import {useState, useEffect} from 'react'
import moviesUtils from '../utils/moviesUtils'

const MovieComp = (props) =>
{
  const [movie, setMovie] = useState({})

  useEffect(async () =>
  {
    setMovie(props.movie);

  },[props])

  const deleteMovie= async ()=>{
    let deleteMovie= await moviesUtils.deleteMovie(props.member._id);
    console.log(deleteMovie);
}

  return(<div style={{width:"300px", borderWidth : "5px", borderStyle : "solid", borderColor : "blue"}}>
        
        Name : {movie.Name} <br/> <br/>

        <img width = "140px" height = "200px" src={movie.Image} /><br/>
        <input type="button" value="Edit"/>
        <input type="button" value="Delete" onClick={deleteMovie}/><br/><br/>

      </div>)
}



export default MovieComp;
